import React from 'react';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import { useState } from 'react';
import './index.css'

function App() {
    return contact.map( contact => 
            <cal.Cardz 
              key = {contact.id}
              name = {contact.name}
              tel = {contact.tel}
              email = {contact.email}
            />)
}
export default App;
